/*!
 * jQuery.quark-alien
 * Licensed under MIT
 * @projectDescription MOTHERFUCKINGQUARKALIEN
 */
(function($) {
	$.fn.alien = function( options ) {
		if(this.hasClass('alienated')) return;
		else this.addClass('alienated');
		var self = this;
		var prefixes = ['', '-webkit-', '-moz-', '-ms-', '-o-'];
		var spriteSmall = 'data:image/gif;base64,';
		var audioSmallStep = "data:audio/mp3;base64,";
		var spriteBig = '';
		var iterationEventTypes = { 'animation':'animationiteration', 'OAnimation':'oAnimationIteration', 'MozAnimation':'animationiteration', 'WebkitAnimation':'webkitAnimationIteration'};
		var endEventTypes = { 'animation':'animationend', 'OAnimation':'oAnimationEnd', 'MozAnimation':'animationend', 'WebkitAnimation':'webkitAnimationEnd'};
		var startEventTypes = { 'animation':'animationstart', 'OAnimation':'oAnimationStart', 'MozAnimation':'animationstart', 'WebkitAnimation':'webkitAnimationStart'};
		var date = new Date();
		var time = date.getTime();
		var alienSmallStepDistance = 24;
		var position = this.css('position');
		if (position !== 'absolute' && position !== 'fixed') position = 'absolute';
		var offset = this.offset();
		var blockWidth = this.width();
		var blockHeight = this.height();
		var stylesheet = $("<style>").attr({ id: time, type: "text/css" }).appendTo("head");
		
		var smallAlien = function(){
			var smallStepAudio;
			var gradientStepWidth = 6;
			var alienSmallSteps = Math.floor((offset.left - 32) / alienSmallStepDistance);
			var gradientSteps = Math.floor(Math.min(blockWidth/gradientStepWidth/2, blockHeight/gradientStepWidth/2));
			var audioSmallFire = "data:audio/mp3;base64,"
			var smallStepAudio = new Audio(audioSmallStep);
			smallStepAudio.play()
			prefixes.forEach(function(prefix){
				var hue = 360;
				var gradientStep = gradientStepWidth;
				var gradientString = ' box-shadow: inset 0 0 0 ' + gradientStep + 'px hsl(360, 100%, 50%)'
				var gradientCss = '@' + prefix + 'keyframes gradient-' + time + ' {';
				for(i=0; i < gradientSteps + 1; i++){
					gradientCss += ' ' + 100 * (i / gradientSteps) + '% {';
						gradientCss += gradientString + '; ';
					gradientCss += '}';
					hue += 8;
					gradientStep += 6;
					gradientString += ', inset 0 0 0 ' + gradientStep + 'px hsl(' + hue + ', 100%, 50%)'
				}
				gradientCss += '}';
				stylesheet.append(gradientCss);
			});
			var alienSmall = $('<div id="alien-' + time + '" >').appendTo('body');
			var innerSmall = $('<div id="inner"-' + time + ' />').appendTo(alienSmall);
			var block = $('<div id="block-' + time + '" />').appendTo('body');
			block.css({
				'position' : position,
				'left' : offset.left,
				'top' : offset.top,
				'width' : blockWidth,
				'height' : blockHeight
			});
			prefixes.forEach(function(prefix){
				block.css( prefix + 'animation' , 'gradient-' + time + ' ' + 0.05 * gradientSteps + 's steps(' + gradientSteps + ') forwards ' + (1.2 + alienSmallSteps * 0.8) + 's');
			})
			alienSmall.css({
				'width' : 50,
				'height' : 32,
				'top' : offset.top + blockHeight / 2 - 16,
				'margin-left' : -25,
				'position' : 'absolute'
			});
			prefixes.forEach(function(prefix){
				alienSmall.css( prefix + 'animation' , 'smallWalk-' + time + ' ' + alienSmallSteps * 0.8 + 's steps(' + alienSmallSteps + ') forwards 0s, smallFire-' + time + ' 0s steps(1) forwards ' + alienSmallSteps * 0.8 + 's');
			})
			innerSmall.css({
				'position' : 'absolute',
				'width' : '100%',
				'height' : '100%',
				'background' : 'url('+spriteSmall+')'
			});
			prefixes.forEach(function(prefix){
				innerSmall.css( prefix + 'animation' , 'smallWalkInner-' + time + ' .8s steps(12) ' + alienSmallSteps + ' forwards 0s, smallFireInner-' + time + ' 1s steps(6) 1 forwards ' + alienSmallSteps * 0.8 + 's');
			})
			prefixes.forEach(function(prefix){
				stylesheet.append(
					'@' + prefix + 'keyframes smallWalk-' + time + ' { 0% { left: 0px; } 100% { left: ' + 24 * alienSmallSteps + 'px; } }\n' +
					'@' + prefix + 'keyframes smallFire-' + time + ' { 0% { width: 50px; } 100% { width: 32px; } }\n' +
					'@' + prefix + 'keyframes smallWalkInner-' + time + ' { 0% { background-position: 0px 0px; } 100% { background-position: -600px 0; } }\n' +
					'@' + prefix + 'keyframes smallFireInner-' + time + ' { 0% { background-position: -600px 0px; } 100% { background-position: -792px 0; } }'
				);
			});
			for(t in endEventTypes){
				if( block[0].style[t] !== undefined ){
					block[0].addEventListener(endEventTypes[t], function(){
						setTimeout(function(){
							block.remove();
							alienSmall.remove();
							self.remove();
							stylesheet.remove();
						}, 1000)
					}, false);
				}
			}
			for(t in iterationEventTypes){
				if( alienSmall[0].style[t] !== undefined ){
					alienSmall[0].addEventListener(iterationEventTypes[t], function(){
						var smallStepAudio = new Audio(audioSmallStep);
						smallStepAudio.play()
					}, false);
				}
			}
			for(t in startEventTypes){
				if( innerSmall[0].style[t] !== undefined ){
					innerSmall[0].addEventListener(endEventTypes[t], function(){
						if(this.fireStarted) return;
							setTimeout(function(){
								smallFireAudio = new Audio(audioSmallFire);
								smallFireAudio.play();
							}, 500)
						this.fireStarted = true;
					}, false);
				}
			}
		}
		var bigAlien = function(){
			var smallStepAudio;
			var alienSmallSteps = Math.floor((offset.left + blockWidth/2 + 16) / alienSmallStepDistance);
			var smallStepAudio = new Audio(audioSmallStep);
			smallStepAudio.play();
			var alienSmall = $('<div id="alien-' + time + '" >').appendTo('body');
			var innerSmall = $('<div id="inner"-' + time + ' />').appendTo(alienSmall);
			alienSmall.css({
				'width' : 50,
				'height' : 32,
				'top' : offset.top + blockHeight / 2 - 16,
				'margin-left' : -25,
				'position' : 'absolute'
			});
			prefixes.forEach(function(prefix){
				alienSmall.css( prefix + 'animation' , 'smallWalk-' + time + ' ' + alienSmallSteps * 0.8 + 's steps(' + alienSmallSteps + ') forwards 0s, smallFire-' + time + ' 0s steps(1) forwards ' + alienSmallSteps * 0.8 + 's');
			});
			innerSmall.css({
				'position' : 'absolute',
				'width' : '100%',
				'height' : '100%',
				'background' : 'url('+spriteSmall+')'
			});
			prefixes.forEach(function(prefix){
				innerSmall.css( prefix + 'animation' , 'smallWalkInner-' + time + ' .8s steps(12) ' + alienSmallSteps + ' forwards 0s, smallFireInner-' + time + ' 1s steps(1) 1 forwards ' + alienSmallSteps * 0.8 + 's');
			})
			prefixes.forEach(function(prefix){
				stylesheet.append(
					'@' + prefix + 'keyframes smallWalk-' + time + ' { 0% { left: 0px; } 100% { left: ' + 24 * alienSmallSteps + 'px; } }\n' +
					'@' + prefix + 'keyframes smallFire-' + time + ' { 0% { width: 50px; } 100% { width: 32px; } }\n' +
					'@' + prefix + 'keyframes smallWalkInner-' + time + ' { 0% { background-position: 0px 0px; } 100% { background-position: -600px 0; } }\n' +
					'@' + prefix + 'keyframes smallFireInner-' + time + ' { 0% { background-position: -600px 0px; } 100% { background-position: -600px 0; } }'
				);
			});
			for(t in iterationEventTypes){
				if( alienSmall[0].style[t] !== undefined ){
					alienSmall[0].addEventListener(iterationEventTypes[t], function(){
						var smallStepAudio = new Audio(audioSmallStep);
						smallStepAudio.play()
					}, false);
				}
			}
		}
		if(!options || options == 'small') smallAlien();
		else if(options == 'big') bigAlien();
		else console.warn('Wrong options for Alien Plugin! Must be "big" or "small"');
	};
}(jQuery));